      -ms-flex-pack: end;
          justify-content: flex-end; }

.chart {
  display: block;
  width: 100%; }

.analytics-row__entry {
  cursor: pointer; }

.report-icons {
  margin: 20px 0;
  float: left; }

.full-width {
  width: 100%; }

.partial-width {
  width: 80%;
  margin-left: 20px; }

.clear-both {
  clear: both; }

.adf-duration-widget-grid {
